import React from 'react';
import Slider from '@mui/material/Slider';
import Box from '@mui/material/Box';
import Chart from "react-apexcharts";
import { useState } from 'react';

function HomeLoan() {

    const [options, setOptions] = useState({
        chart: {
            type: 'donut',
        },
        labels: ['A', 'B', 'C', 'D', 'E'],
        legend: {
            show: false,
        },
        plotOptions: {
            pie: {
                donut: {
                    size: '70%',
                },
            },
        },
        dataLabels: {
            enabled: true,
        },
        stroke: {
            show: false,
        },
    });
    const [series, setSeries] = useState([44, 55, 41, 17, 15]);

    const [cost, setCost] = useState(0);
    const [Intrest, setIntrest] = useState(10);
    const [fee, setFee] = useState(1);
    const [downPayment, setDownPayment] = useState(0);
    const [tenure, setTenure] = useState(0);


    const calCulateEmai = (downPayment) => {
        if (!cost) return

        const loanAmt = cost - downPayment;
        const rateOfInterest = Intrest / 100;
        const numOfYears = tenure / 12;

        const EMI =
            (loanAmt * rateOfInterest * (1 + rateOfInterest) ** numOfYears) /
            ((1 + rateOfInterest) ** numOfYears - 1);

        return Number(EMI / 12).toFixed(0);
    }


    return (
        <>
            <div className="Emi_calculater_reacted">
                <div className='Emi_firsted_calculated'>
                    <div className="Emi_releted_amount">
                        <div className="Emi_first_field">
                            <div className="monthly_emi_pay">
                                <p>Monthly EMI Pay</p>
                                <p className='payment'>₹ 61,725</p>
                            </div>
                            <div>
                                <hr style={{ color: "black", height: "50px" }} />
                            </div>
                            <div className="monthly_emi_pay">
                                <p>Monthly EMI Pay</p>
                                <p className='payment'>₹ 61,725</p>
                            </div>
                        </div>
                        <div className="Emi_second_field">
                            <div className="Emi_loan_amount_fild">
                                <p>Loan Amount</p>
                                <input type="text"
                                    state={cost}
                                    setState={setCost}
                                    style={{ width: "90px", outline: "none" }} />
                            </div>
                            <div className='emi_slider'>
                                <Box sx={{ width: 500 }}>
                                    <Slider defaultValue={0} aria-label="Default" valueLabelDisplay="auto" />
                                </Box>
                            </div>
                            <div className='emi_par_anuman'>
                                <p>₹ 5 lakh</p>
                                <p>₹ 10 cr</p>
                            </div>
                        </div>
                        <div className="Emi_second_field">
                            <div className="Emi_loan_amount_fild">
                                <p>Tenure</p>
                                <input
                                    type="text"
                                    style={{ width: "90px", outline: "none" }} />
                            </div>
                            <div className='emi_slider'>
                                <Box sx={{ width: 500 }}>
                                    <Slider defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
                                </Box>
                            </div>
                            <div className='emi_par_anuman'>
                                <p>5 year</p>
                                <p>30 year</p>
                            </div>
                        </div>
                        <div className="Emi_second_field">
                            <div className="Emi_loan_amount_fild">
                                <p>Interest Rate (% P.A.)</p>
                                <input
                                    type="text"
                                    state={Intrest}
                                    setState={setIntrest}
                                    style={{ width: "90px", outline: "none" }} />
                            </div>
                            <div className='emi_slider'>
                                <Box sx={{ width: 500 }}>
                                    <Slider defaultValue={50} aria-label="Default" valueLabelDisplay="auto" />
                                </Box>
                            </div>
                            <div className='emi_par_anuman'>
                                <p>7%</p>
                                <p>8%</p>
                            </div>
                        </div>
                    </div>
                    <div className="second_emi_calculater">
                        <div className='second_first_calculate'>
                            <div className="donut">
                                <Chart options={options} series={series} type="donut" width="380" />
                            </div>
                            <div className='graph_side'>
                                Are you all set to apply? Take the leap and begin your home loan journey.
                            </div>
                        </div>
                        <div className="Emi_second_field_calculated">
                            <div className="monthly_emi_pay">
                                <p>Principal</p>
                                <p>Amount</p>
                                <p className='payment'>₹ 61,725</p>
                            </div>
                            <div>
                                <hr style={{ color: "black", height: "90px" }} />
                            </div>
                            <div className="monthly_emi_pay">
                                <p>Intrest </p>
                                <p>Amount</p>
                                <p className='payment'>₹ 61,725</p>
                            </div>
                        </div>

                    </div>
                </div>
            </div>
        </>
    );
}

export default HomeLoan;
